import React, { Component } from 'react'
import { connect } from 'react-redux'
import { NavLink } from 'react-router-dom'

class Nav extends Component {
 render() { 
   const { username } = this.props
   console.log('username : ',username);
  return (
    <nav class="navbar navbar-expand-lg navbar-light bg-light">
  		<div class="container-fluid">
    		<ul class="navbar-nav me-auto mb-2 mb-lg-0">
        		<li class="nav-item"> 
    				<NavLink to='/home' exact activeClassName='active' class="nav-link"> Home </NavLink>
       			</li>
    			<li class="nav-item"> 
    				<NavLink to='/leaderBoard' class="nav-link"> LeaderBoard </NavLink> 
    			</li>
     			<li class="nav-item">
        			<NavLink to='/newQuestion' class="nav-link"> New Question </NavLink>
    			</li>
    			<li class="nav-item">
        			<label class="nav-link"> Hello {username}</label>
    			</li>
    			<li class="nav-item">
        			<NavLink to='/' class="nav-link"> Log Out </NavLink>
    			</li>
    		</ul>
    	</div>
    </nav>
  )
 }
}

function mapStateToProps({users,authedUser}) {
  console.log(users)

  if(authedUser) {
    console.log('a',authedUser)
  }
   return {
     username:  ''
   }
}

export default connect(mapStateToProps)(Nav)
